      string: "[{\n  \"id\": \"3027118290362405993\",\n  \"type\": \"Image\",\n  \"shortCode\":
        \"CoCfAv2I5Rp\",\n  \"caption\": \"Sunday's Alpkit SofA: Sonder Winter Gravel
        Series in Bristol. There was a great turn out despite the drizzle and fog
        and the start went pretty smoothly. It wasn't long before people were hiking
        bikes through ankle deep mud and hills that were just too technical and slippery,
        even for the more advanced riders. The people I met were great and there was
        definitely some fun descents and potential trails for the warmer months. Unfortunately,
        just before the midway point, I decided to take the wrong line down a rocky
        boulder descent, came off and smacked my head. Annoyed that I lost my glasses,
        but the bike was okay! It was a fun half day when I look back on it, just
        wish I'd been able to finish. #coffee #mountainbike #mountainbiker #mountainbikes
